import React from 'react';
import './css/dashboard.css'
function Dashboard(){
    return (
        <div className="container">
        <div className = "row">
          <div className = "col-md-4">
            <h3>Alert</h3>
          </div>
          <div className = "col-md-4">
            <h3>Pressure</h3>
            <input type ="range" min="0" max="100 "/>
            <h3>FlowRate</h3>
            <input type ="range" min="0" max="100 "/>
            <h3>Ph Value</h3>
            <input type ="range" min="0" max="100 "/>
          </div>
          <div className = "col-md-4">
            <h3>Number of devices connected</h3>
          </div>
        </div>
      </div>
    );
};
export default Dashboard;
